@Injectable({
  providedIn: 'root'
})

export class TestService {

    constructor() { }

    testCards(iter: number){
        var cards = new Array(iter );
        for (let i = 1; i <= iter; i++) {
            cards[i-1] = {
                Id : 'C-' + i,
                Nombre: "Carta #" + i,
                Energia: 10,
                Costo: 10,
                Imagen: 'data:image/png;base64,',
                Raza: "Raza",
                Tipo: "Basica",
                Descripcion: "Esta es una descripcion de prueba",
                Estado: true
            }
        }
        return cards
    }

    testPlanets(iter: number){
        var planets = new Array(iter);
        for (let i = 1; i <= iter; i++) {
            planets[i-1] = {
                Id : 'P-' + i,
                Nombre: "Planeta #" + i,
                Imagen: 'data:image/png;base64,',
                Popularidad: "Basico",
                Descripcion: "Esta es una descripcion de prueba",
                Efecto: "Efecto Prueba",
                Estado: true
            }
        }
        return planets
    }

    testDecks(iter:number) {
        var decks = new Array(iter);
        for (let i = 1; i <= iter; i++) {
            decks[i-1] = { 
                Id : 'D-' + i,
                Nombre: "Deck #" + i,
                Cartas: this.testCards(18),
                Estado: false
            }
        }
        return decks
    }
}